import React from 'react';
import './App.css';

class App extends React.Component {
	private title: string = 'Welcome to the Quiz!'
	private data

	render(){
		return (
			<div className="App">
				<div id="title">
					{this.title}
				</div>
				<Question></Question>
				<Answers></Answers>
				<Submit></Submit>

			</div>
		);
	}

}

	export default App
